void mime_init (nitpick& nits)
{   type_master < t_mime > :: init (nits, mimetype_symbol_table, sizeof (mimetype_symbol_table) / sizeof (symbol_entry < html_version, e_mimetype >));
    type_master < t_format > :: init (nits, format_symbol_table, sizeof (format_symbol_table) / sizeof (symbol_entry < html_version, e_format >)); }

e_format extension_format (nitpick& , const html_version& v, const ::std::string& ext, flags_t& flags)
{   return type_master < t_format > :: find (v, ext, ns_default, nullptr, nullptr, &flags); }

bool is_compatible_extension (const html_version& v, const e_mimetype em, const ::std::string& ext)
{   if (v.mjr () < 4) return true;
    nitpick nits;
    flags_t flags = 0;
    const e_format mimex = extension_format (nits, v, ext, flags);
    if (mimex == mime_bork) return true;
    return (em == static_cast < e_mimetype> (mimex)); }

bool has_external_vulnerability (nitpick& nits, const html_version& , const e_mimetype em)
{   const flags_t f (type_master < t_mime > :: flags (em));
    if ((f & MIME_SCRIPT) != 0)
        nits.pick (nit_reputation, es_error, ec_mime, "cross site scripting leaves the integrity, security and reputation of your site dependent on the good practice and intent of the third-party site");
    else if ((f & MIME_STYLE) != 0)
        nits.pick (nit_reputation, es_warning, ec_mime, "the security, integrity, presentation and reputation of your site is dependent on the good practice and intent of the external site");
    else return false;
    return true; }

bool has_embed_vulnerability (nitpick& nits, const html_version& v, const e_mimetype em)
{   if (v.mjr () < 4) return false;
    const flags_t f (type_master < t_mime > :: flags (em));
    if ((f & MIME_APPLICATION) != 0)
        nits.pick (nit_reputation, es_warning, ec_mime, "referring to an external site leaves the reputation of your site dependent on their good practice and intent");
    else if ((f & (MIME_AUDIO | MIME_FONT | MIME_IMAGE | MIME_VIDEO)) != 0)
        nits.pick (nit_reputation, es_comment, ec_mime, "referring to an external site leaves means the reputation of your site dependent on their good practice and intent");
    else if ((f &  MIME_MULTIPART) != 0)
        nits.pick (nit_reputation, es_info, ec_mime, "referring to an external site here leaves the reputation of your site dependent on their good practice and intent");
    else return false;
    return true; }

bool has_extension_incompatibility (nitpick& nits, const html_version& v, const e_mimetype em, const ::std::string& ext)
{   if (ext.empty () || (em == mime_bork) || (em == mime_context)) return false;
    flags_t flags = 0;
    const e_mimetype mt (static_cast < e_mimetype > (extension_format (nits, v, ext, flags)));
    if ((mt == mime_context) || (mt == mime_bork)) return false;
    if (mt == em) return false;
    if ((flags & MIME_COMMON_MASK) != 0)
        if ((flags & type_master < t_mime> :: flags (em) & MIME_COMMON_MASK) != 0) return false;
    nits.pick (nit_incompatible_mime, es_info, ec_mime, "the file extension ", quote (ext), " is not normally associated with ", quote (type_master < t_mime > :: name (em)));
    return true; }

void check_extension_compatibility (nitpick& nits, const html_version& v, const flags_t family, const ::std::string& ext)
{   if ((! ext.empty ()) && (family != 0))
    {   const e_mimetype em = static_cast < e_mimetype> (type_master < t_format > :: find (v, ext, ns_default));
        if ((em != mime_context) && (em != mime_bork))
        {   const flags_t flags = type_master < t_mime > :: flags (em);
            if ((family & flags) == 0)
                nits.pick (nit_incompatible_mime, es_info, ec_mime, "a file with extension '.", ext, "' is unsuitable here"); } } }

void check_extension_compatibility (nitpick& nits, const html_version& v, const e_mimetype mt, const ::std::string& ext)
{   if (! ext.empty ())
    {   const e_mimetype em = static_cast < e_mimetype> (type_master < t_format > :: find (v, ext, ns_default));
        if ((em != mime_context) && (em != mime_bork))
            if (em != mt)
                nits.pick (nit_incompatible_mime, es_info, ec_mime, "a file of media type ", type_master < t_mime > :: name (mt), " is expected"); } }

void check_extension_compatibility (nitpick& nits, const html_version& v, const e_mimetype em, const vurl_t& u, const bool src)
{   for (auto uu : u)
    {   if (uu.has_extension ()) has_extension_incompatibility (nits, v, em, uu.extension ());
        if (src && ! uu.is_local ()) has_embed_vulnerability (nits, v, em); } }

void check_extension_compatibility (nitpick& nits, const html_version& v, const ::std::string& s, const vurl_t& u, const bool src)
{   if (! s.empty ())
    {   nitpick nuts;
        const e_mimetype mt = examine_value < t_mime > (nuts, v, s);
        if ((mt != mime_bork) && (mt != mime_context))
            check_extension_compatibility (nits, v, mt, u, src); } }

void check_extension_compatibility (nitpick& nits, const html_version& v, const vurl_t& u, const flags_t family)
{   PRESUME (family != 0, __FILE__, __LINE__);
    for (auto uu : u)
        if (uu.has_extension ()) check_extension_compatibility (nits, v, family, uu.extension ()); }

void check_extension_compatibility (nitpick& nits, const html_version& v, const vurl_t& u, const e_mimetype mt)
{   for (auto uu : u)
        if (uu.has_extension ()) check_extension_compatibility (nits, v, mt, uu.extension ()); }

bool report_flag_issues (nitpick& nits, const html_version& , const e_mimetype em, const bool specified, const ::std::string& ref)
{   bool res = false;
    const flags_t f (type_master < t_mime > :: flags (em));
    if (specified && ((f & MIME_UNOFFICIAL) == MIME_UNOFFICIAL))
    {   nits.pick (nit_mime, ed_mimetype, "https://www.iana.org/assignments/media-types/media-types.xhtml", es_info, ec_mime, quote (type_master < t_mime > :: name (em)), " is a non-standard media type");
        res = true; }
    if ((f & MIME_WITHDRAWN) == MIME_WITHDRAWN)
    {   if ((f & MIME_VULNERABLE) == MIME_VULNERABLE)
            nits.pick (nit_reputation, es_warning, ec_mime, "insecure, vulnerable media/file type ", quote (ref), " withdrawn");
        else nits.pick (nit_reputation, es_info, ec_mime, "media/file type ", quote (ref), " is no longer valid");
        res = true; }
    else if ((f & MIME_VULNERABLE) == MIME_VULNERABLE)
    {   nits.pick (nit_reputation, es_warning, ec_mime, "media/file type ", quote (ref), " is insecure and vulnerable");
        res = true; }
    if ((f & MIME_WINDOWS) == MIME_WINDOWS)
        nits.pick (nit_os_dependent, es_comment, ec_mime, "media/file type ", quote (ref), " requires Windows");
    else if ((f & MIME_MACOS) == MIME_MACOS)
        nits.pick (nit_os_dependent, es_comment, ec_mime, "media/file type ", quote (ref), " requires MacOS / OS X");
    else if ((f & MIME_IOS) == MIME_IOS)
        nits.pick (nit_os_dependent, es_comment, ec_mime, "media/file type ", quote (ref), " requires iOS");
    else if ((f & MIME_ANDROID) == MIME_ANDROID)
        nits.pick (nit_os_dependent, es_comment, ec_mime, "media/file type ", quote (ref), " requires Android");
    else return res;
    return true; }

void check_mimetype_vulnerability (nitpick& nits, const html_version& v, const e_mimetype em, const bool local, const bool specified, const ::std::string& ref)
{   if (! local) has_external_vulnerability (nits, v, em);
    report_flag_issues (nits, v, em, specified, ref); }

void check_mimetype_vulnerability (nitpick& nits, const html_version& v, const ::std::string& s, const bool local, const bool specified)
{   if (! s.empty ())
    {   nitpick nuts;
        const e_mimetype mt = examine_value < t_mime > (nuts, v, s);
        if ((mt != mime_bork) && (mt != mime_context))
            check_mimetype_vulnerability (nits, v, mt, local, specified, s); } }

void check_extension_vulnerability (nitpick& nits, const html_version& v, const ::std::string& ext, const bool local)
{   if (! ext.empty ())
    {   flags_t flags = 0;
        const e_mimetype em (static_cast < e_mimetype > (extension_format (nits, v, ext, flags)));
        if ((em != mime_context) && (em != mime_bork))
            check_mimetype_vulnerability (nits, v, em, local, false, ext); } }

void check_extension_vulnerability (nitpick& nits, const html_version& v, const vurl_t& vu)
{   for (auto u : vu)
        if (u.has_extension ())
            check_extension_vulnerability (nits, v, u.extension (), u.is_local ()); }

void check_vulnerability (nitpick& nits, const html_version& v, const e_mimetype em, const ::std::string& ext, const bool local)
{   const bool ee = ext.empty ();
    if ((em != mime_bork) && (em != mime_context))
    {   if (! ee) has_extension_incompatibility (nits, v, em, ext);
        check_mimetype_vulnerability (nits, v, em, local, true, type_master < t_mime > :: name (em)); }
    if (! ee) check_extension_vulnerability (nits, v, ext, local); }

void check_vulnerability (nitpick& nits, const html_version& v, const e_mimetype em, const vurl_t& u, const bool src)
{   for (auto uu : u)
    {   if (uu.has_extension ())
            check_vulnerability (nits, v, em, uu.extension (), uu.is_local ());
        if (src && ! uu.is_local ()) has_embed_vulnerability (nits, v, em); } }

void check_vulnerability (nitpick& nits, const html_version& v, const ::std::string& s, const vurl_t& u, const bool src)
{   if (! s.empty ())
    {   nitpick nuts;
        const e_mimetype mt = examine_value < t_mime > (nuts, v, s);
        check_vulnerability (nits, v, mt, u, src); } }

void check_mimetype_family (nitpick& nits, const html_version& v, const e_mimetype em, const flags_t family, const ::std::string& ref)
{   report_flag_issues (nits, v, em, true, ref);
    const flags_t flags = type_master < t_mime > :: flags (em);
    if ((family & flags) == 0)
        nits.pick (nit_incompatible_mime, es_info, ec_mime, type_master < t_mime > :: name (em), " is unsuitable here"); }

void check_mimetype_family (nitpick& nits, const html_version& v, const ::std::string& s, const flags_t family)
{   vstr_t ms (split_by_space (s));
    for (auto ss : ms)
    {   nitpick nuts;
        const e_mimetype mt = examine_value < t_mime > (nits, v, s);
        if ((mt != mime_bork) && (mt != mime_context))
            check_mimetype_family (nits, v, mt, family, ss); } }
